import React from 'react';
import Slider from 'react-slick';
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";


const ProductsSliderMenue = () => {
    Let: settings = {
        dot:true,
        infinite:true,
        speed:500,
        slidesToShow:3,
        slidesToScroll:1,
        cssEase:"linear"
    }
    return (
       <ProductsSliderMenue {...settings}>
       <cardWrapper>
           <Card>
               <CardImage>
                   <img src='../Images/Hamburger.jpg'/>
               </CardImage>
           </Card>
       </cardWrapper>

       </ProductsSliderMenue>
    )
}

export default ProductsSliderMenue
